import React, { Component } from 'react';
import './App.css';
import MenuBar from './Components/MenuBar';

class App extends Component {

state = {
item: [
  {name: 'personal'},
],
showMenu: false
}

  toggleMenu = () => {
    const doesShow = this.state.showMenu;
    this.setState({showMenu: !doesShow});
  }

  render() {
    return (
      <div className="App">
        <div className="top">
        <MenuBar onClick={this.toggleMenu}>Toggle Name</MenuBar>
        </div>
        <div className="row">
          <div className="column left">
          <p>left</p>

          </div>
          <div className="column right">
          <p>right</p>

          </div>
        </div>
      </div>
    );
  }
}

export default App;
